const Navbar = () => (
  <nav className="bg-clippersBlue text-clippersWhite w-64 h-screen p-4 fixed top-0 left-0">
    <h1 className="text-xl font-bold mb-8">LA Clippers Showcase</h1>
    <div className="space-y-4 text-center">
      <a href="/" className="block hover:underline">Home</a>
      <a href="/team" className="block hover:underline">Team</a>
      <a href="/league" className="block hover:underline">League</a>
    </div>
  </nav>
);

export default Navbar;
